import React from "react";
import "./MyMessage.css";

class MyMessage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoading: false,
    };
  }

  render() {
    return (
      <div class="mine messages">
        <div class="message">this.props.firstMessage</div>
        <div class="message last">Leg</div>
      </div>
    );
  }
}

export default MyMessage;
